<?php
require_once('./CurlRequest.php');

$binary =　'';

$key = 'AIzaSyCPXDhrgU98j4Jbg9joy5nb0AXU-3Coyf0';
$uri = 'https://vision.googleapis.com/v1/images:annotate';
$parameters = array(
    'fields' => 'responses(error%2CfullTextAnnotation%2ClabelAnnotations%2ClogoAnnotations%2CtextAnnotations)',
    'key' => $key
);

$body = array(
    'requests' => array(
        array(
            'image' => array(
                'content' => $binary,
            ),
            'features' => array(
                array(
                    'type' => 'TEXT_DETECTION',
                    'maxResults' => '1',
                ),
            ),
        ),
    ),
);

$opt = array(
    //curl options
    CURLOPT_RETURNTRANSFER => true,
    CURLOPT_SSL_VERIFYPEER => false,
    CURLOPT_SSL_VERIFYHOST => false,
    CURLOPT_VERBOSE => true,
    CURLOPT_POST => true,
    CURLOPT_POSTFIELDS => json_encode($body)
);

print_r(json_encode($body));

$client = new CurlRequest($uri);
$result = $client->request($parameters, $opt);

print_r($result);

